import React from 'react';
import Logo from '../components/Logo';
import Goodiespagemember from '../components/Goodiespagemember';
import Navigationmember from '../components/Navigationmember';

const Goodiesmember = () => {
    return (
        <div>
            <Logo />
            <Navigationmember />
            <Goodiespagemember />
        </div>
    );
};

export default Goodiesmember;
